(22, 79, '1085916496', 'a:19:{s:2:"id";s:10:"1085916496";s:4:"name";s:15:"Alyssa Margolis";s:10:"first_name";s:6:"Alyssa";s:9:"last_name";s:8:"Margolis";s:4:"link";s:39:"http://www.facebook.com/alyssa.margolis";s:8:"username";s:15:"alyssa.margolis";s:8:"birthday";s:10:"08/19/1992";s:8:"hometown";a:2:{s:2:"id";s:15:"107991659233606";s:4:"name";s:16:"Atlanta, Georgia";}s:8:"location";a:2:{s:2:"id";s:15:"112825518732186";s:4:"name";s:22:"Fort Collins, Colorado";}s:3:"bio";s:175:"Is officially accepted at Colorado State University into their Biomedical Science program. My first big step into becoming a Veterinarian :) <3\r\n\r\nIdk.......ask me a question?";s:6:"quotes";s:1969:""Only two things are infinite, the universe and human stupidity, and I''m not sure about the former." ~Albert Einstein\r\n\r\n"The time will come when men such as I will look upon the murder of animals as they now look on the murder of men."\r\n~Leonardo da Vinci\r\n\r\nAsk the experimenters why they experiment on animals, and the answer is: "Because the animals are like us." Ask the experimenters why it is morally okay to experiment on animals, and the answer is: "Because the animals are not like us." Animal experimentation rests on a logical contradiction. ~Charles R. Magel\r\n\r\n"From beasts we scorn as soulless,\r\nIn forest, field and den,\r\nThe cry goes up to witness\r\nThe soullessness of men."\r\n~M. Frida Hartley\r\n\r\n"The question is not, "Can they reason?" nor, "Can they talk?" but rather, "Can they suffer?"" ~Jeremy Bentham\r\n\r\n"Hunting is not a sport. In a sport, both sides should know they''re in the game." ~Paul Rodriguez\r\n\r\n"Never doubt that a small group opf thoughtful, committed citiizens can change the world, it''s the only thing that ever does." - Margaret Mead\r\n\r\n"I''ve always felt that animals are the purest spirits in the world. They don''t fake or hide their feelings, and they are the most loyal creatures on Earth. And somehow we humans think we''re smarterwhat a joke." ~ P!nk \r\n\r\n"We are the living graves of murdered beasts, slaughtered to satisfy our appetites. How can we hope in this world to attain the peace we say we are so anxious for? "~George Bernard Shaw \r\n\r\n"If we cut up beasts simply because they cannot prevent us and because we are backing our own side in the struggle for existence, it is only logical to cut up imbeciles, criminals, enemies, or capitalists for the same reasons." ~C. S. Lewis \r\n\r\n"Animals are my friends...and I don''t eat my friends." \r\n~George Bernard Shaw\r\n\r\n"I bet The Rev can beat Chuck Norris using a pink fly swatter.... R.I.P" ~rockbandmaster234 (some youtube user who commented on the Bat Country Video)";s:6:"sports";a:1:{i:0;a:2:{s:2:"id";s:15:"103780659661402";s:4:"name";s:6:"Skiing";}}s:9:"education";a:2:{i:0;a:4:{s:6:"school";a:2:{s:2:"id";s:15:"112581762088211";s:4:"name";s:21:"Arrowhead High School";}s:4:"year";a:2:{s:2:"id";s:15:"144044875610606";s:4:"name";s:4:"2011";}s:4:"type";s:11:"High School";s:4:"with";a:1:{i:0;a:2:{s:2:"id";s:10:"1070910100";s:4:"name";s:10:"Jd Dembski";}}}i:1;a:4:{s:6:"school";a:2:{s:2:"id";s:15:"112424965440042";s:4:"name";s:25:"Colorado State University";}s:4:"year";a:2:{s:2:"id";s:15:"105576766163075";s:4:"name";s:4:"2015";}s:13:"concentration";a:1:{i:0;a:2:{s:2:"id";s:15:"168324403215654";s:4:"name";s:18:"Biomedical Science";}}s:4:"type";s:7:"College";}}s:6:"gender";s:6:"female";s:5:"email";s:20:"snarkologist@aim.com";s:8:"timezone";i:-6;s:6:"locale";s:5:"en_US";s:8:"verified";b:1;s:12:"updated_time";s:24:"2011-09-20T04:03:26+0000";}', '2011-10-03 23:16:21', '2011-10-03 23:16:21'),
