(38, 123, '1558770089', 'a:16:{s:2:"id";s:10:"1558770089";s:4:"name";s:16:"Ilana Sivachenko";s:10:"first_name";s:5:"Ilana";s:9:"last_name";s:10:"Sivachenko";s:4:"link";s:35:"http://www.facebook.com/isivachenko";s:8:"username";s:11:"isivachenko";s:8:"birthday";s:10:"05/25/1992";s:3:"bio";s:194:"A year ago, six months ago, I thought that I was an artist. I no longer think about it, I am. Everything that was literature has fallen from me. There are no more books to be written, thank God.";s:6:"quotes";s:568:""The only dream worth having is to dream that you will live while you are alive, and die only when you are dead. To love, to be loved. To never forget your own insignificance. To never get used to the unspeakable violence and vulgar disparity of the life around you. To seek joy in the saddest places. To pursue beauty to its lair. To never simplify what is complicated or complicate what is simple. To respect strength, never power. Above all to watch. To try and understand. To never look away. And never, never to forget."\r\nThe God of Small Things by Arundhati Roy.";s:9:"education";a:2:{i:0;a:4:{s:6:"school";a:2:{s:2:"id";s:15:"107758985913693";s:4:"name";s:24:"Newton South High School";}s:4:"year";a:2:{s:2:"id";s:15:"118118634930920";s:4:"name";s:4:"2012";}s:4:"type";s:11:"High School";s:7:"classes";a:2:{i:0;a:3:{s:2:"id";s:15:"133467783387958";s:4:"name";s:27:"Acting and Directing Honors";s:4:"with";a:6:{i:0;a:2:{s:2:"id";s:10:"1054129083";s:4:"name";s:9:"Alex Levy";}i:1;a:2:{s:2:"id";s:9:"551590868";s:4:"name";s:15:"Jackie Lebovits";}i:2;a:2:{s:2:"id";s:10:"1315453830";s:4:"name";s:9:"Gil Blume";}i:3;a:2:{s:2:"id";s:10:"1402980211";s:4:"name";s:18:"Aggravated Snorlax";}i:4;a:2:{s:2:"id";s:9:"728847920";s:4:"name";s:11:"Allie Haber";}i:5;a:2:{s:2:"id";s:10:"1313213018";s:4:"name";s:19:"Daniel Bender Stern";}}}i:1;a:3:{s:2:"id";s:15:"189240567773621";s:4:"name";s:14:"English Honors";s:4:"with";a:8:{i:0;a:2:{s:2:"id";s:10:"1110159488";s:4:"name";s:9:"Tricia Ho";}i:1