(9, 5, 3, 'accessories', 'Swatch', '', 'F', 'swatch', 1, 0.00, 0.00, 0.00, '/img/pricetag/flyfoenix_buynowtag_24.png', 0.00, '2011-09-09 18:49:58'),
(4, 2, 1, 'shop', 'Annie - OSU', 'Rhinestones, Glitter and Glam all in one little fashioniesta tee shirt. This flashy little number features a graffiti print with sparkle and shine. Tagless Comfort. ', 'F', '3209', 1, 44.00, 29.99, 29.99, '/img/pricetag/flyfoenix_buynowtag_29.png', 20.00, '2011-09-09 16:23:40'),
(26, 4, 5, 'shop', 'WVU - Vintage Tri Blend Tee', 'This Tri Blend Tee is lightweight and offers a stylis vintage look and super soft feel.  The athletic cut highlights the chest and shoulders with a little more room from chest to waist.  Take a closer look at the unique pattern and colors created using Tri Blend material.', 'M', 'DR120T', 1, 24.99, 24.99, 24.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 14.99, '2011-10-01 13:57:49'),
(6, 3, 1, 'shop', 'Cowboy Rain Boots - OSU', 'Stomp in any weather with these cowboy rain boots.', 'F', 'cowboy boots', 1, 45.00, 45.00, 39.99, '/img/pricetag/flyfoenix_buynowtag_39.png', 29.50, '2011-09-09 16:51:08'),
(25, 4, 4, 'shop', 'UNC - Vintage Crew Neck Tee', 'The Vintage Crew Neck Tee is constructed of 100% cotton for everyday comfort and long-term durability.  This tee will get better with each wash!  Relaxed fit with a slight athletic cut in the chest and shoulders.', 'M', 'DR100', 1, 24.99, 24.99, 24.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 14.99, '2011-10-01 13:49:50'),
(13, 3, 3, 'accessories', 'Bottle Cozy', 'Keep your drinks cold no matter the temperature.', 'F', 'cozy', 1, 4.99, 4.99, 4.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 2.50, '2011-09-10 10:38:26'),
(17, 2, 3, 'accessories', 'Sipper Cups', 'Double-wall insulated sipper cup with reusable straw holds 16 ounces of your favorite tailgate toddy! Exterior printing and coordinating straw makes it extra cute and we recommend hand-washing to keep it looking great.', 'F', '', 1, 7.99, 7.99, 7.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 4.00, '2011-09-15 13:48:08'),
(16, 3, 3, 'accessories', 'Head Wrap', 'Our new crocheted headwraps will keep your ears comfy and warm on game day with soft acrylic yarn. Each headwrap features a large layered flower with a crystal button accent. It can also be worn around the neck as a sassy scarf!', 'F', 'Accessory Head Wrap', 1, 14.99, 0.00, 14.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 7.50, '2011-09-14 16:09:56'),
(18, 2, 3, 'accessories', 'Stadium Stem Cups', 'Double-wall insulated stem cup holds 12 ounces of your favorite tailgate toddy! Printed paper insert with reverse polka dot pattern are sealed inside and will make you smile as you raise your glass to cheer on your team. We recommend hand-washing to keep it looking great.', 'F', '', 1, 9.99, 9.99, 9.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 5.00, '2011-09-15 13:49:35'),
(19, 2, 3, 'accessories', 'Lunch &amp; Beer Bag', 'Neoprene construction keeps your lunch (or six-pack of beverages) insulated and is also water resistant and machine washable.', 'F', '', 1, 12.99, 12.99, 12.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 7.50, '2011-09-15 14:14:42'),
(20, 2, 3, 'accessories', 'Tailgate Party Tubs', 'Fill this tub with the "spirit" of your choice for the perfect addition to any tailgate party. The sturdy tin tub holds up to 12 standard bottles/cans or up to 4 large soda/wine bottles and is a great size for any size gathering at 15"Wx9"Dx9"H.\r\n<br/><br/>\r\nThe neoprene cover provides excellent insulation and is easily removed for machine washing or embroidering. Insulated neoprene cover also reduces condensation.', 'F', '', 1, 29.99, 29.99, 29.99, '/img/pricetag/flyfoenix_buynowtag_29.png', 19.50, '2011-09-15 14:16:17'),
(21, 2, 3, 'accessories', 'Stadium Umbrella', 'Adorable full-sized 36" diameter umbrella folds up to 11" tall so its easy to carry on the go or around campus. The coordinating ruffled trim and curved rubber handle are perfect for the girly-girl who wants to stay cute AND dry. Features an auto-open button and sturdy steel frame.', 'F', '', 1, 19.99, 19.99, 19.99, '/img/pricetag/flyfoenix_buynowtag_24.png', 14.50, '2011-09-15 14:18:03'),
