INSERT INTO `pstyles` (`id`, `name`, `desc`) VALUES
('1437', 'Krista', 'This tee features distressed print school logo, foil print, & rhinestones.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless comfort. Cotton/Spandex.'),
('1480', 'Kimberly', 'This tee features foil print, studs, rhinestones, & flat sequins.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style.  Tagless comfort. Cotton/Spandex.'),
('3221', 'Nikki', 'Classic v-neck tee now comes in a fashionable relaxed fit! Relaxed fit sizing provides more room in the chest and waist.  Featuring distressed school logo print, shine foil, & rhinestones. Tagless comfort. Cotton/Spandex.'),
('1481', 'Taylor', 'Add this long sleeve tee to your game day collection! Featuring distressed print with rhinestone encrusted logo and mascot on the sleave. The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style.  Tagless comfort. Cotton/Spandex.'),
('3350', 'Tallie', 'This thigh length tank can be worn over jeans or as a dress.  Featuring a rhinestone encrusted logo print.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style.  Tagless comfort. Cotton/Spandex.'),
('3153', 'Summer', 'This fleece full zip hoodie features your team mascot''s name on the right sleeve in a rhinestone application, with a distressed logo foil logo printed on the chest.  Tagless comfort. Long, fashion fit. Cotton/Spandex.'),
('3210', 'Rylan', 'Always look sexy in this v-neck! Featuring a newspaper print with foil and stones.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('3204', 'Megan', 'Confetti fabric tee featuring glitter & studs.   The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex. Imported.'),
('3223', 'Marissa', 'New relaxed fit long sleeve tee. This tee is embellished with full coverage foil with stones, perfect for any day.   Relaxed fit sizing provides more room in the chest and waist.  Tagless comfort. Cotton/Spandex.'),
('2771', 'Lulu', 'This is definitely a cute - tee! This tee features the school name in glitter dots, perfect for that little fan with a lot of style. Tagless Comfort. Cotton/Spandex. Imported.'),
('3203', 'Layla', 'This shirt features sequins, rhinestones, foil print and glitter. The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('3214', 'Kirsten', 'Flaunt your sleek & sporty side! Featuring contrast piping, shine foil print, & rhinestones on front and back. Tagless comfort. Cotton/Spandex.'),
('3211', 'Kiera', 'This long sleeved tee features a white textured print, foil print and studs.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('3222', 'Fiona', 'This tee features a gold or silver foil print with rhinestones on top.  The fabric is designed to be soft, comfortable and of the highest quality.  Relaxed fit sizing provides more room in the chest and waist.  Tagless comfort.  Cotton/Spandex.'),
('1985', 'Emma', 'Looking for some glitz for the little one? We have you covered with this 2fer, featuring a school logo and mascot on the sleeve. Tagless Comfort. Cotton/Spandex. Imported.'),
('3213', 'Cortney', 'This fleece full zip hoodie features your team mascot''s name on the right sleeve in a rhinestone application, with a distressed logo foil logo printed on the chest.  Tagless comfort. Long, fashion fit. Cotton/Spandex.'),
('3224', 'Colleen', 'This shirt features sequins, rhinestones, foil print and glitter. The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('3292', 'Chloe', 'This number 1 mascot tee features distressed print with rhinestones.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('2416', 'Cassi', 'This tank features distressed shine printed logo & rhinestones.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('3267', 'Caitlin', 'This shirt features a torso length foil print. The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('2391', 'Billie', 'This long sleeved tee features a gold or silver foil print with rhinestones on top.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style.  Tagless comfort. Cotton/Spandex.'),
('2415', 'Bella', 'This fleece pant features a distressed shine logo printe, with foil rhinestones and/or studs.  Super soft and cut for the just the right fit.  Tagless comfort.  Fleece/Cotton/Spandex.'),
('2480', 'Avery', 'For the littlest fan at the game! Sport this classic tee featuring a distressed school logo with foil and rhinestones at every game. Tagless Comfort. Cotton/Spandex. Imported.'),
('3209', 'Annie', 'This is a full coverage foil print tee.  The fabric is designed to be soft, comfortable and of the highest quality.  The fit is designed to highlight a woman''s figure and provide comfort and style. Tagless Comfort. Cotton/Spandex.'),
('2525', 'Ava', 'Rhinestones, Glitter and Glam all in one little fashioniesta tee shirt. This flashy little number features a graffiti print with sparkle and shine. Tagless Comfort. Cotton/Spandex. Imported.'),
('DR100', 'Vintage Crew Neck Tee', 'The Vintage Crew Neck Tee is constructed of 100% cotton for everyday comfort and long-term durability.  This tee will get better with each wash!  Relaxed fit with a slight athletic cut in the chest and shoulders.'),
('DR1765', 'Dolman Tee', 'The sleeves on this Dolman Tee are cuffed and roomy to match the relaxed fit of this 50/50 poly-cotton blended piece.  The neck-line is wide with a slim color that easily drapes around your shoulders.'),
('DR1745T', 'Tri Blend Scoop Back', 'The sleeves on this Scoop Back top are 3/4 length for versatile comfort in cool or warm weather.  The split color easily drapes over the neck-line.  Constructed from lightweight Tri Blend material for a vintage look and a super soft feel.'),
('DR115', 'Vintage Tee w/Sleeve Hit', 'The Vintage Crew Neck Tee is constructed of 100% cotton for everyday comfort and long-term durability.  This tee will get better with each wash!  The team logo is also featured on the left sleeve.  Relaxed fit with a slight athletic cut in the chest and shoulders.'),
('DR115T', 'Vintage Tri Blend Tee w/Sleeve Hit', 'This Tri Blend Tee is lightweight and offers a stylis vintage look and super soft feel.  The athletic cut highlights the chest and shoulders with a little more room from chest to waist.  Take a closer look at the unique pattern and colors created using Tri Blend material.'),
('DR1726', 'V-Neck Tee', 'This V-Neck Tee has a slim color that falls lightly around the neck and shoulders for a comfartable yet sexy style.  This tee is roomy and designed for a woman''s physique.'),
('DR1715T', 'Tri Blend Tee w/Sleeve Hit', 'This Tri Blend Tee is lightweight and offers a stylis vintage look and super soft feel.  The team logo is also featured on the left sleeve.  The athletic cut highlights the chest '),
('DR120T', 'Vintage Tri Blend Tee', 'This Tri Blend Tee is lightweight and offers a stylis vintage look and super soft feel.  The athletic cut highlights the chest and shoulders with a little more room from chest to waist.  Take a closer look at the unique pattern and colors created using Tri Blend material.'),
('BOOT', 'Stadium Stompers', 'These cowgirl-style rubber boots have a 2" heel and 13" high boot shaft and feature a cotton lining and removable insoles for extra comfort.  Stadium Stompers are great for rain and snow (with an extra pair of socks). Available in whole sizes only. If you''re between sizes, we recommend ordering the next size up because they narrow at the toe for added style.');
